_.oc=function kP(a){var b,c,d;b=new LC;c=Ek(a.f,43);d=Ad(c.x)+$wnd.pageYOffset+10;Oz(b,new aB("<div><h1>Reasons of using Solar<\/h1><br><h3>Durability & Longevity<\/h3><p>On average, a solar panel can last up to 30 years or more.With just a few arrays set up, you can be powering your home withyour own renewable energy. Not only that, but solar panels are designed to withstand harsh climates. One common misconception is that you need the sun shining to convert toelectricity. Solarpanels can still convert from solar energy to electrical or thermal power even on a cloudy day (although not at the same capacity)<\/p><h3>Unlimited Power<\/h3><p>While everyone else is crying and whining about gas prices and high energy costs - you will have an unlimited supply of solar power. Unless the sun blows up and destroys our entire solar system - you won't really need to worry about never having power.<\/p><h3>Tax Incentives<\/h3><p>Once you invest into solar, you are eligible for Federal, State, Provincial And Utility Tax incentives and rebates. These aren't the'$30 off' from your coffee maker rebates - they add up big time! For example, in Australia, if you spend $16,000 on a solar set up, they will rebate you up to $8000 back. This doesn't include other rebates you can get either. You'll need to check your own country's government policies - but, in the next 5-10 years - all countries will be jumping on the solar bandwagon.<\/p><h3>Not Just A 'One Time' Set Up + Easy Installation<\/h3><p>With solar, you don't need to invest into a bunch of costly arraysrightaway. You're able to set up one panel at a time, and add additional panels whenever you feel the time is right. Furthermore,installing a solar panel is actually quite a lot easier than peoplethink. You can do it yourself, or have an installer come and have itset up for you the same day.<\/p><\/div>"));IC(b,50,d);JC(b)};_.cM={10:1,21:1};_=mP.prototype=lP.prototype=new u;_.gC=function nP(){return Up};_.oc=function oP(a){var b,c her technologies under development that may offer high efficiencies even in inclement weather, such as 'super black' solar cells, but most of these are still either expensive or not yet commercially available.<\/p><br><p>Roof space available for solar panels. One obvious factor to be taken into consideration when mounting panels on a roof is the amount of space available on it. A typical polycrystalline or monocrystalline panel measures about 1.6m x 1m, and depending on the capacity (size in watts) of your system, for an average 2 or 3-bedroom home, you should be able to fit enough panels to significantly offset your electricity costs on one, or in a stretch, two parts of your roof. Closeness of the panels to your home is not an absolute requirement: the roofs of sheds, garages, and balconies that stand slightly apart from your house may also provide options for placement.<\/p><\/div>"));IC(b,50,d);JC(b)};_.cM={10:1,21:1};_=AP.prototype=tP.prototype=new vv;_.gC=function BP(){return Wp};var uP;_=FP.prototype=CP.prototype=new _w;_.gC=function GP(){return Xp};var DP=null;_=RP.prototype=HP.prototype=new u;_.gC=function SP(){return Zp};_.tS=function TP(){return QP(this)};_.cM={48:1,74:1};_.e=null;_.f=null;_.g=null;_.i=null;_.j=null;_.k=null;_=YP.prototype=VP.prototype=new u;_.gC=function ZP(){return $p};_.tS=function $P(){return $T+UQ(this.a)+ZT};_.cM={48:1};_.a=null;_=mQ.prototype=_P.prototype=new u;_.gC=function nQ(){return _p};_.tS=function oQ(){return lQ(this)};_.cM={48:1};_.a=null;_.b=null;_.c=null;_.d=null;_.e=null;_.f=null;_.g=null;_.i=null;_=TQ.prototype=pQ.prototype=new u;_.gC=function VQ(){return bq};_.tS=function WQ(){return SQ(this)};_.cM={48:1};_.d=null;_.e=null;_.f=null;_=YQ.prototype=XQ.prototype=new Wb;_.gC=function ZQ(){return aq};_.cM={48:1,57:1,67:1,75:1};var cR=vc;var Yo=UH(aU,'Object'),Mk=UH(bU,'AjaxKeyConstants_'),cp=UH(aU,mR),vq=TH(cU,'String;'),Nk=UH(bU,'AjaxLoader$1'),dp=UH(aU,'Throwable'),Oo=UH(aU,'Exception'),Vk=UH(dU,'Animation'),Ok=UH(dU,'Ani
